1. Three pennies and one jar of jellyfish jelly cost \$1.24:
\[ 3p + j = 1.24 \]

2. Two pennies and one jar of jellyfish jelly cost \$1.82:
\[ 2p + j = 1.82 \]

We can solve these equations step by step. First, let's subtract the second equation from the first equation to eliminate \( j \):

\[ (3p + j) - (2p + j) = 1.24 - 1.82 \]
\[ 3p + j - 2p - j = -0.58 \]
\[ p = -0.58 \]

